import React from 'react';
import Accordion from 'react-bootstrap/Accordion';
import Button from 'react-bootstrap/Button';

import SearchUserItem from './UserItem/SearchUserItem';
import './UserList.css';

const searchUserList = props => {
  console.log(" search user list:  ", props.searchUsers);
  if (props.searchUsers.isArray() !== true) {
    console.log(`
      turn searchUsers to array
      `);
  }
  const searchUsers = props.searchUsers.map(user => {
    return (
      <React.Fragment>
      <SearchUserItem
        key={user._id}
        userId={props.authUserId}
        _id={user._id}
        name={user.name}
        email={user.email}
        role={user.role}
        onDetail={props.onViewDetail}
      />
      </React.Fragment>
    );
  });
  return <ul className="user__list1">{searchUsers}</ul>;
};

export default searchUserList;
